export default class ArrayList {
  constructor() {
    this.INTERNAL_CAPASITY = 10;
    this.internalArray = [/*INTERNAL_CAPASITY */];
    this.pointer = 0;
  }

  // Amortized O(1)
  addToEnd(item) {
    if (this.pointer < this.INTERNAL_CAPASITY) {
      // There is empty space still in the internal array
      this.internalArray[this.pointer++] = item;
    } else {
      // There is no empty space
      // resize de internal array
      this.resize();
    }
  }

  resize() {
    this.INTERNAL_CAPASITY =+ 10;
    // Creating new array with double space
    let newternalArray = [/*INTERNAL_CAPASITY+10*/];
      
    for (let i = 0; i < this.INTERNAL_CAPASITY; i++) {
      newternalArray[i] = this.internalArray[i];
    }
    this.internalArray = newternalArray;
    

    /**
     * The beuaty of JavaSript
     * this.internalArray = [...this.internalArray,FIVE_UN,FIVE_UN];
     */
  }

  // O(N)
  addToHead(item) {
    if (this.pointer < this.INTERNAL_CAPASITY) {
      // There is empty space still in the internal array
      this.moveAlltoRight(0);
      this.internalArray[0] = item;
    } else {
      // There is no empty space
      // resize de internal array
    }
  }

  // O(N) in the worst case
  insert(index, item) {
    if (!this.isValidIndex(index)) return;

    this.moveAlltoRight(index);
    this.internalArray[index] = item;
  }

  // O(1)
  removeFromEnd() {
    if (this.size() > 0) {
      this.pointer--;
      return this.internalArray.pop();
    }

    return undefined;
  }

  // O(N)
  removeFromHead() {
    if (this.size() > 0) {
      const firstItem = this.internalArray[0];
      this.moveAlltoLeft(1);
      this.pointer--;
      return firstItem;
    }

    return undefined;
  }

  // O(N) in the worst case
  remove(index) {
    if (!this.isValidIndex(index)) return undefined;

    const item = this.internalArray[index];
    this.internalArray[index] = undefined;
    this.moveAlltoLeft(index + 1);
    this.pointer--;
    return item;
  }

  // O(1)
  get(index) {
    if (!this.isValidIndex(index)) return undefined;

    return this.internalArray[index];
  }

  // O(1)
  size() {
    return this.pointer;
  }

  // O(1)
  isEmpty() {
    return this.pointer === 0;
  }

  isValidIndex(index) {
    return index >= 0 && index < this.size();
  }

  /*
   * Thii method will take all the items in the right of the given index (given index inclusive)
   * and move them 1 step right
   */
  moveAlltoRight(index) {
    if (!this.isValidIndex(index)) return;

    for (let i = this.size() - 1; i >= index; i--) {
      this.internalArray[i + 1] = this.internalArray[i];
    }
    this.internalArray[index] = undefined;
    this.pointer++;
  }

  /*
   * Thii method will take all the items in the left of the given index (given index inclusive)
   * and move them 1 step left. Note first index will dissappear
   */
  moveAlltoLeft(index) {
    if (!this.isValidIndex(index)) return;

    for (let i = index; i < this.size(); i++) {
      if (i === 0) continue;
      this.internalArray[i - 1] = this.internalArray[i];
    }

    this.internalArray.pop();
  }

  print() {
    console.log("Printing the ArrayList");
    for (let i = 0; i < this.INTERNAL_CAPASITY; i++) {
      console.log(this.internalArray[i]);
    }
  }
}
